import React, { useEffect, useState } from "react";
import {TablePagination,Paper} from "@material-ui/core"

const Page = () => {
    const [post, setPost] = useState([])
    const [page,setPage] = useState(0)
    const [rowsPerPage, setRowsPerPage] = React.useState(10);
    const [dataCount, setDataCount] = useState("");



    const handleChangePage = (event, newPage) => {
        setPage(newPage);
      };
    
      const handleChangeRowsPerPage = (event) => {
        setRowsPerPage(parseInt(event.target.value, 10));
        setPage(0);
      };
      const PageAfterPagination = () => {
        return post.slice(page * rowsPerPage, (page + 1) * rowsPerPage);
      };

    useEffect(() => {
        fetch('https://jsonplaceholder.typicode.com/posts/')
            .then(response => response.json())
            .then(json => setPost(json))

    }, [])
    console.log(post)
    return (
        <div >
          <div style={{
            display: "grid", gridTemplateColumns: 'repeat(auto-fit, minmax(400px, 1fr))',
            gridAutoFlow: 'row', gap: '2rem', justifyItems: 'center'
            , padding: '2rem',
            width: '95%'
        }}>
           {post && post.length > 0 ? (
              PageAfterPagination().map((element, index) => (
                   <div key={index}>
                     <title>{element.title}</title>
                     <p>{element.body}</p>
                   </div>
                  ))
            ) : (
              <div>
                <p>No data found</p>
              </div>
            )}
            </div>
            
           
            <Paper
              style={{
                borderRadius: "18px",
                marginTop: "10px",
                boxShadow: "none",
              }}
            >
          {post && post.length > 0 ? (
            <TablePagination
              component="div"
              rowsPerPageOptions={[10, 20, 50]}
              count={post.length}
              rowsPerPage={rowsPerPage}
              page={page}
              onChangePage={handleChangePage}
              onChangeRowsPerPage={handleChangeRowsPerPage}
            />
          ) : (
            ""
          )}
          </Paper>
        </div>
    )
}

export default Page;
